import React from 'react';

const WeeklyScoresPage = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h2>Weekly Scores</h2>
      <p>Here you'll see how many correct picks each player got for the selected week.</p>
      {/* TODO: Add table showing players, correct picks, and gold stars */}
    </div>
  );
};

export default WeeklyScoresPage;
